import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";

class App extends Component {
  constructor() {
    super();
    this.state = {
      monsters: [
        {
          name: "kevin",
        },
        {
          name: "robert",
        },
        {
          name: "gaston",
        },
      ],
    };
  }
  render() {
    return (
      <div className="App">
        <div className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <h2>Welcome to React Lucas</h2>
          {() => {
            this.setState(this.state.monsters[1].name = "Julien");
          }}
          {this.state.monsters.map((element, index) => (
            <h3 key={index}>{element.name}</h3>
          ))}

          {console.log(this.state.monsters[1].name)}
        </div>
        <p className="App-intro">
          To get started, edit <code>src/App.js</code> and save to reload.
        </p>
      </div>
    );
  }
}

export default App;
